import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Switch>
      <Route path="/login" component={SignUpForm} />
      <Route path="/dashboard">
        <Layout>
          <Dashboard />
        </Layout>
      </Route>
      <Route path="/project/:id">
        <Layout>
          <Project />
        </Layout>
      </Route>
      <Route path="">
        <Redirect to="/login" />
      </Route>
    </Switch>
  );
}

export default App;
